The #CovidVaccine booster isn't just for the over 40s. You can book your booster 6 months after your 2nd dose if you're 16+ and you have a health condition that puts you at greater risk from #Covid19.
Book your #boostervaccine online here: https://t.co/XAaUH3SaZR

